import React from "react";

function Header() {
    return (
        <nav className="navbar">
        <ul className="flex bg-amber-200 p-0">
            <li>Home</li>
            <li>My Profile</li>
            <li>Class</li>
        </ul>
        </nav>
    )
}

export default Header
